import React, { useRef, useState } from "react";
// Import Swiper React components
import SwiperCore, { Autoplay } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";

// import required modules
import { Navigation } from "swiper";

export default function ProjectCarousel() {
  SwiperCore.use([Autoplay]);
  return (
    <div className="content" id="projectCarousel">
      <Swiper watchSlidesProgress={true} autoplay={{ delay: 10000 }} slidesPerView={4} className="mySwiper projectSwiper">
        <SwiperSlide className="projectSlide">Slide 1</SwiperSlide>
        <SwiperSlide className="projectSlide">Slide 2</SwiperSlide>
        <SwiperSlide className="projectSlide">Slide 3</SwiperSlide>
        <SwiperSlide className="projectSlide">Slide 4</SwiperSlide>
        <SwiperSlide className="projectSlide">Slide 4</SwiperSlide>
        <SwiperSlide className="projectSlide">Slide 4</SwiperSlide>
      </Swiper>
    </div>
  );
}
